could you recommend some idea fot it? Thank you so much for reading my question. </p>; Answer: Again, though, I don't think these are "strange". `CHAR()` has all sorts of caveats in every RDBMS that all come down to the necessary padding to fill bytes on the disk. It's not a CPU issue, but rather a data storage issue that then results in increased cpu because of the trimming that has to take place every time an operation is applied against the `CHAR()` typed field. Generally the only advantage of `char()` is decreased disk space for known length fields, but we are talking about 1-4 bytes, minus compression, so it's really just not worth it.

