How to write a Spring Data MongoDB query using Date manipulation<p>I want to write a mongodb query using spring data repository @Query annotation and here is my requirement:</p>

<blockquote>
  <p><strong>Get all the Vins that were added in the last sixty minutes and they are still active</strong></p>
</blockquote>

<p>"keepAlive" is the time in milliseconds a particular VIN is active. When a record is entered in database, "keepAlive" can be set as 30 minutes, 60 minutes etc</p>

<p>Example data:</p>

<blockquote>
<pre><code>{ vin: "ANBCDERGGGHHGUTY", keepAlive: "3600000", dateAdded: "2019-12-16T16:45:29-05:00" }
{ vin: "T5765ERGGGHHGUTX", keepAlive: "1800000", dateAdded: "2019-11-14T13:41:29-03:00" }
</code></pre>
</blockquote>

<p>Here are my classes:</p>

<pre><code>public class MyEntity {
    private String vin;
    private long keepAlive;
    private Date dateAdded;
}
</code></pre>

<p>I have tried something like this but it doesn't seem to work:</p>

<pre><code>@Query(value = "{'keepAlive':{$lte : {$subtract: [?0, 'dateAdded']}}}")
List&lt;MyEntity&gt; findLatestVins(Date currentSystemDate);
</code></pre>

<p>Any idea how can I do this?</p>

